import React, { useState, useEffect } from 'react';
import './House.css'

const Houses = () => {
  const [houses, setHouses] = useState([]);

  useEffect(() => {
    fetch('/approvedhouses')
      .then((r) => r.json())
      .then((data) => setHouses(data));
  }, []);

  return (
    <div>
      <h1>House List</h1>
      <div>

      </div>

    </div>
  );
};

export default Houses;
